Laying out straw signals a 2-6 hour rest for the dogs. This is something that is trained, but Trinket, in her excitement, chewed her neck line. A big no no…

Trinket’s a sensitive soul and has a soft temperament. I gently corrected her, letting her know it’s unacceptable by calmly bitting her nose. A quick lesson learned, followed by a satisfying meal of TEAM DOG and beef soup, paved the way for the dogs to cover nearly 100 miles in about 13 hours. 
