Running a team of 17 dogs requires a lot of work. That’s 68 paws that need ointment and booties; and before each run I load foot powder in each bootie. I have gotten to the point now where I can harness and bootie the team in just about 45 minutes if I’m moving quick and stay focused.

Hooking up is often the most difficult part of the entire run, but the most important part is the post run meal. Replenishing the calories spent is critical for a team of sled dogs And the FTK Pack couldn’t be more happy to be TEAM DOGS! After each run the dogs eat about 15lbs of ground beef turned into a soup and about 25 lbs of Team Dog elite blend of chicken and sweet potato. 
